import Image from "../images/instagram-brands.svg";
const Footer = () => {
  return (
    <div className="footer">
      <div className="footer-p">
        <p>Natascha Henriksen</p>
        <p>
          Email <br /> nataschavejenhenriksen@gmail.com
        </p>
        <img  className="instagram"src={Image}/>
        <p>
          {" "}
          Facebook <br />
          QuietlyThriving
        </p>
      </div>
    </div>
  );
};

export default Footer;
